import React from 'react';

function Scorebar(props) {
    
        return (
        <div>
            <span>HighScore = {props.clickedMessage}</span>
        <span>clicked Message = {props.clickedMessage}</span>
        <span>click Guess = {props.correctGuess}</span>
        </div>
  );
}



export default Scorebar;
